import React from "react";

const VideoFeed: React.FC = () => {
  return (
    <div>
      <h3>Live Video Feed</h3>
      <img
  src={`/video_feed?t=${Date.now()}`}
  alt="Live Video Feed"
  style={{ width: "100%", maxWidth: "640px" }}
/>
    </div>
  );
};

export default VideoFeed;
